import React, {useState} from 'react'


function Authform(){ 

    const initialInputs = { 
        username: "", 
        password: ""
    }

    const {login, setLogin } = useState(initialInputs)


    function handleChange(e){ 
       const {name, value} = e.target
       setLogin(prev => ({ 
           ...prev,
           [name]: value
       }))
    }

    return( 
        <div> 
            <input 
            type = "text"
            placeholder = "Username"
            value = {login}
            name = "username"
            onChange = {handleChange}/>
            <input 
            type = "text"
            placeholder = "Password"
            value = {login}
            name = "password"
            onChange = {handleChange}/>

        </div>
    )
}

export default Authform
